import React from 'react';
import {Menu, Col} from 'antd';
import { MailOutlined, AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
function Header(props) {
    const { SubMenu } = Menu;
    return (
        <Menu mode="horizontal" id="banner">
         <Row>
             <Col flex={4}>a</Col>
         </Row>
        </Menu>
    );
}

export default Header;
